import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Navbar from './Component/Navbar';
import './Style/App.scss';
import SlideRecord from './Pages/SlideRecord';
import SpeedSlalomRecord from './Pages/SpeedSlalomRecord';
import Home from './Pages/Home';

interface AthleteForm {
  name: string;

}

interface SpeedSlalom extends AthleteForm {
  result: any;
  side: "L" | "R";
  step: number;
  time: number;
  missedCone: number;
  kickCone: number;

}

const App = () => {
  return (
    <div className='App'>
      <div className='Navbar'>
        <Navbar />
      </div>
      <main>
        <div className='Container'>
          <p>Training Recoord</p>
            <Routes>
              <Route path="/Componnent/Home" element={<Home />} />
              <Route path="/Componnent/SlideRecord" element={<SlideRecord />} />
              <Route path="/Componnent/SpeedSlalomRecord" element={<SpeedSlalomRecord />} />
            </Routes>
        </div>
      </main>
    </div>
  );
};

export default App;
